import React from "react"
class TodoList extends React.Component{
    constructor(props){
        super(props)
        this.state ={
            items:[]
        }
    }
    render(){

        return(

            <div>
                <ul className="list-group">
                {this.props.tasks.map((task)=>{
                    return <li className="list-group-item">{task}</li>
                })}

                </ul>
            </div>
        )
    }
}
export default TodoList
